    /**
     * 输出重复的字符串(重复字符串只取一次)
     * @param s	源字符串
	 * @param reg 分隔符
	 * @return 重复的字符串
     */
	public static String getRepeatString(String s,String reg) {
        String[] str = s.split(reg);
        StringBuffer strb = new StringBuffer();

        int j=0;
		for(int i=0;i<str.length;i++) {
			int firstIndex = s.indexOf(str[i]);
			int lastIndex = s.lastIndexOf(str[i]);
			if(firstIndex!=lastIndex && strb.toString().indexOf(str[i])==-1) {
                strb.append(str[i]);
                strb.append(reg);
            }else if(firstIndex!=lastIndex && strb.toString().indexOf(str[i])>-1){
				j++;	//计算重复的字符串个数
			}
        }
		System.out.println(j);
		return strb.toString();
	}
	/**
     * 去除源字符串中重复的字符串
     * @param s 源字符串
     * @param reg 分隔符
     * @return  去除重复字符串后的目标字符串
     */
	public static String removeRepeatString(String s,String reg) {
		String[] str = s.split(reg);
		StringBuffer goalString = new StringBuffer();
		StringBuffer repeatString = new StringBuffer();
		System.out.println(str.length);
		for(String each:str) {
			if(!(goalString.indexOf(each) > -1)) {
				goalString.append(each);
				goalString.append(reg);
			}else {
				repeatString.append(each);	//获取所有重复的字符串
				repeatString.append(reg);
			}
        }
        System.out.println();
		System.out.println(goalString.toString());
		return goalString.toString();
	}
